import React from 'react';

export default function ListData(props) {
    const state = props.state;

    return (
        state.dataRecords.map((item, index) =>
            <p key={index.toString()}> {item.id} {item.firstName} {item.lastName} {item.gender} {item.email}{item.mobileNumber}</p>
        )
    );
}
